import { Step, StepLabel, Stepper } from "@mui/material";
import React from "react";

const StepperBar = () => {
  const stepper = 0;

  return (
    <div>
      <Stepper orientation="vertical">
        <Step>
          <StepLabel></StepLabel>
        </Step>
        <Step>
          <StepLabel></StepLabel>
        </Step>
        <Step>
          <StepLabel></StepLabel>
        </Step>
      </Stepper>
    </div>
  );
};

export default StepperBar;
